export function DCHECK(bool) {
  if (!bool) {
    throw new Error();
  }
}
export function DCHECK_EQ(a, b) {
  if (a !== b) {
    throw new Error();
  }
}
export function DCHECK_NE(a, b) {
  if (a === b) {
    throw new Error();
  }
}
